    let date=new Date()
    let hora=date.getHours()
    let zona=date.getTimezoneOffset()/60


    return(
        <div>
            <div>
                hora:{hora}
                zona:{zona}
                ref:{hora+zona}
            </div>
        </div>

    )
}
